def transformer_part2(
    token_position: int,
    head: int,
    head_size: int,
    key_cache_layer: List[List[int]],
    attention: List[int],
) -> List[int]:
    return matrix_vec_mul(
        matrix_col_slice(
            matrix_row_slice(key_cache_layer, 0, token_position + 1),
            head * head_size,
            (head + 1) * head_size,
        ),
        vec_slice(attention, 0, token_position + 1),
    )
